pragma solidity ^0.8.0;

contract IsEven {   
    function numb(uint _newNum) public pure returns(string memory){
        string memory stroka;
        if (_newNum % 2 == 1) {
            return stroka = "even";
        } else {
            return stroka = "odd";
        }
    }
}

